<script>
const AREA_OPTIONS = ["Birch Achres", "Blue Downs", "Browns Farm", "Centurion", "Chief Albert Luthuli Park", "Clayville", "Crossroads", "Daveyton", "Delft", "Drift Sands", "Du Noon", "Duduza", "Ebony Park", "Etwatwa", "Evaton", "Evaton Small Farms", "Ext8. Midrand 1685", "Fordsburg", "Forest Village", "Green Point Khayelitsha", "Gugulethu", "Harare", "Ikwezi Park", "Ivory Park", "Kaalfontein", "Katlehong", "Khayelitsha", "Khayelitsha \u2013 Site B", "Khayelitsha \u2013 Site C", "Klipfontein", "Klipfontein View", "Kraaifontein", "Kraaifontein east", "Kuyasa", "Kwa-Thema", "Langa", "Litha Park", "Litha Park, Khayelitsha", "Lower Crossroads", "Luzuko", "Lwandle", "Makhaza", "Mandalay", "Manenberg", "Mayfair", "Mfuleni", "Mhakaza", "Mhakaza, Khayelitsha", "New Cross", "Nonzamo", "Nyanga", "Olievenhoutbos", "Olifantsfontein", "Olifantsfontein 410-JR, Tembis", "Orange Farm", "Palm Ridge", "Philipi", "Rabie Ridge", "Rabie Ridge, Midrand, 1688", "Samora", "Sebokeng", "Strand", "Sweet Home", "Tembisa", "The Leagues", "Thembisa", "Tokoza", "Tsakane", "Unknown", "Vosloorus", "Windmill Park", "Winnie Mandela", "Winnie Mandela "];
const NODE_OPTIONS = ["gt-dvtn-clssec", "gt-dvtn-gglsec", "gt-dvtn-jsmsec", "gt-dvtn-lmssec", "gt-dvtn-pdfsec", "gt-dvtn-sdksec", "gt-dvtn-stmsec", "gt-dvtn-tpsec", "gt-klfn-kfsec", "gt-ktlh-blbsec", "gt-ktlh-ebnsec", "gt-ktlh-khsec", "gt-ktlh-kwzsec", "gt-ktlh-mpdsec", "gt-ktlh-mrjsec", "gt-ktlh-ndlsec", "gt-ktlh-plmsec", "gt-ktlh-prwsec", "gt-ktlh-rhpsec", "gt-ktlh-sqbsec", "gt-ktlh-tkzsec", "gt-ktlh-wmpsec", "gt-midr-olivetwosec", "gt-midr-shgsec", "gt-midr-stvsec", "gt-ogfm-llbsec", "gt-ogfm-mpmsec", "gt-sbkg-evwsec", "gt-sbkg-kgssec", "gt-sbkg-mstsec", "gt-tmba-bkmsec", "gt-tmba-chmsec", "gt-tmba-jrcsec", "gt-tmba-mntsec", "gt-tmba-mqsec", "gt-tmba-ofsec", "gt-tmba-ofsec-scagg", "gt-tmba-rrsec", "gt-tmba-thsec", "gt-tmba-wmdsec", "gt-tskn-ddzsec", "gt-tskn-knmsec", "gt-tskn-mmlsec", "wc-bunk-crsec-rtr", "wc-dlft-dfssec", "wc-duno-dusec", "wc-gugu-dsec", "wc-gugu-gusec", "wc-gugu-gwsec", "wc-kftn-enkatcsec", "wc-khye-bsec", "wc-khye-cpssec", "wc-khye-kcsec", "wc-khye-kisec", "wc-khye-kypsec", "wc-khye-msec", "wc-khye-ndsec", "wc-lang-lasec", "wc-mfln-nlksec", "wc-nomz-nosec", "wc-nyan-bfasec", "wc-nyan-nysec", "wc-nyan-ssec"];

function normalize(value) {
    return String(value ?? "").toLowerCase().trim();
}

function getGraph() {
    return document.getElementById("map");
}

function populateOptions() {
    const areaSelect = document.getElementById("area-select");
    AREA_OPTIONS.forEach(area => {
        const opt = document.createElement("option");
        opt.value = area;
        opt.textContent = area;
        areaSelect.appendChild(opt);
    });

    const nodeSelect = document.getElementById("node-select");
    NODE_OPTIONS.forEach(node => {
        const opt = document.createElement("option");
        opt.value = node;
        opt.textContent = node;
        nodeSelect.appendChild(opt);
    });
}

document.getElementById("select-all-btn").onclick = () => {
    const sel = document.getElementById("node-select");
    for (let i = 0; i < sel.options.length; i++) {
        sel.options[i].selected = true;
    }
};

function applyFilters() {
    const gd = getGraph();
    const showZero = document.getElementById("toggle-zero").checked;
    const onlyZero = document.getElementById("toggle-only-zero").checked;
    const search = normalize(document.getElementById("search-text").value);
    const area = normalize(document.getElementById("area-select").value);
    const nodeSel = document.getElementById("node-select");
    const nodes = Array.from(nodeSel.selectedOptions).map(o => normalize(o.value));

    let count = 0;

    gd.data.forEach((trace, idx) => {
        if (idx === 0) return; // dummy colorbar trace
        if (trace.name === "Nodes") return;
        const custom = trace.customdata || [];
        const newOpacity = [];

        for (let i = 0; i < custom.length; i++) {
            const ikeja = normalize(custom[i][0]);
            const deviceId = normalize(custom[i][1]);
            const node = normalize(custom[i][3]);
            const deviceName = normalize(custom[i][11]);
            const siteArea = normalize(custom[i][4]);
            const zeroFlag = Boolean(custom[i][10]);

            let ok = true;
            if (onlyZero) {
                if (!zeroFlag) ok = false;
            } else if (!showZero && zeroFlag) {
                ok = false;
            }

            if (search) {
                const matchesSearch =
                    ikeja.includes(search) ||
                    deviceId.includes(search) ||
                    deviceName.includes(search);
                if (!matchesSearch) ok = false;
            }

            if (area && siteArea !== area) ok = false;
            if (nodes.length && !nodes.includes(node)) ok = false;

            if (ok) {
                count += 1;
                newOpacity.push(0.9);
            } else {
                newOpacity.push(0.05);
            }
        }

        Plotly.restyle(gd, {"marker.opacity": [newOpacity]}, [idx]);
    });

    document.getElementById("count-label").textContent = "Visible: " + count;
}

document.addEventListener("DOMContentLoaded", () => {
    populateOptions();
    const gd = getGraph();
    gd.once("plotly_afterplot", () => {
        document.getElementById("apply-btn").onclick = applyFilters;
        applyFilters();
    });
});
</script>
